import React from 'react'
import PropTypes from 'prop-types'
import Moment from 'react-moment';


const LogItem = ({log}) => {
    return (
        <li className="collection-item">
            <div>
               <a 
                 href="#edit-log-modal"
                 className={`modal-trigger ${log.working ? 'red-text':'blue-text'}`}>{log.work}</a>
               <br/>
               <span className="grey-text">
                    <span className="black-text">ID #{log.id}</span>{' '}
                    <span className="blac-text">{log.tech}</span> <br/> Surveyed on {' '}
                    <Moment format="MMM Do YYYY, h:mm:ss a'"></Moment>
               </span>
               <a href="#edit-log-modal" className="waves-effect waves-light btn  secondary-content">+Add</a>
               <br/>
               <a href="#!" class="waves-effect waves-light btn  secondary-content">-Remove</a>
            </div>
        </li>
    )
}

LogItem.propTypes = {
    log: PropTypes.object.isRequired
}

export default LogItem;
